import './App.css';

import React from 'react';

import {
  BrowserRouter,
  Route,
} from 'react-router-dom';

import Acceuil from './component/Acceuil';
import Menu from './component/Menu';

function App() {
  return (
    <BrowserRouter>
      <Menu />
      <Route path='/' component={Acceuil} />
    </BrowserRouter>
  );
}

export default App;
